document.addEventListener("DOMContentLoaded", function()
	{
            var navList = document.querySelectorAll('#main-menu>li.nav-item');
            
            for (var i=0; i<navList.length; i++){
                if(!navList[i].classList.contains('active')){
                    navList[i].addEventListener('mouseover', function(event){
                        event.currentTarget.classList.add('active');
                    });
                    navList[i].addEventListener('mouseout', function(event){
                        event.currentTarget.classList.remove('active');
                    });
                }
            }
            var catParent = document.querySelectorAll('.cat-parent');

            if(catParent){
            	var children = [];
            	for(var i=0; i<catParent.length; i++){
            		children[i] = catParent[i].querySelector('.children');
            		// children[i].style.display = "none";
            		catParent[i].querySelector('a').innerHTML += ' <i class="fa fa-plus-circle" aria-hidden="true"></i>';
            		catParent[i].querySelector('a').href = "#"
            		catParent[i].addEventListener('click', 
            			function(event){
		            		var elem = event.currentTarget;
		            		elem.classList.toggle('opened');
		            		event.stopPropagation();
		            		event.preventDefault();
            		},true);
            	}

            }
	});


